INSERT INTO `si121_postmeta` VALUES (2553,363,'exhibitors_row_layout_1_exhibitors_description','MarketplaceLIVE\'s exhibit floor is arranged in alphabetical order by company name. Each exhibitor receives the same sized space (5x6x10), complete with a high-boy table, two stools, and the option to bring a 7-ft banner where you can clearly promote your logo and message.\r\n\r\nSpace is limited and fills up fast. Exhibitors are confirmed on a first come first serve basis. To guarantee your presence <strong>please <a href=\"mailto:marketplacelive@telx.com\">email us</a></strong> to secure your exhibit space');
